import React from 'react';

const Animations = () => {
  return (
    <div >
      <br></br>
    <img style={{align:'center'}} src = '1.gif'></img>
    <img style={{align:'center'}} src = '2.gif'></img>
    <img style={{align:'center'}} src = '3.gif'></img>
    <img style={{align:'center'}} src = '4.gif'></img>
    </div>
  );
};

export default Animations;
